package com.amir.steelsenseandroidtask.domainimport com.amir.steelsenseandroidtask.domain.model.ChartEntryimport javax.inject.Injectclass ChartRepositoryImpl @Inject constructor() : ChartRepository {    override fun getAllChartData(): List<List<ChartEntry>> {        val dataset1 = List(10) { ChartEntry(it.toFloat(), (100..1000).random().toFloat()) }        val dataset2 = List(10) { ChartEntry(it.toFloat(), (100..1000).random().toFloat()) }        val dataset3 = List(10) { ChartEntry(it.toFloat(), (100..1000).random().toFloat()) }        return listOf(dataset1, dataset2, dataset3)    }}